		  var msw = (x >> 16) + (y >> 16) + (lsw >> 16);
		  return (msw << 16) | (lsw & 0xFFFF);
		},

		  var bin = Array();

		  for(var i = 0; i < str.length * this.chrsz; i += this.chrsz)
		    bin[i>>5] |= (str.charCodeAt(i / this.chrsz) & mask) << (i%32);
		  return bin;
